if (!interval || interval < 1) {
    result = me.HistoInfos;
} else {
    var sum=0, cnt=1, length = me.HistoInfos.getRowCount(), intV = interval;
	for (var i=0; i<length; i++) {
        if (me.HistoInfos[i].valueX <= intV) {
            sum += parseInt(me.HistoInfos[i].value,10);
        } else {
            result.AddRow({"valueX":intV, "value":sum});
            sum = parseInt(me.HistoInfos[i].value,10);
            cnt++;
            intV = interval * cnt;
        }
        if (i == (length-1)) {
            result.AddRow({"valueX":intV, "value":sum});
        }
    }
}

function getRandomIntInclusive(min, max) {
  min = Math.ceil(min);
  max = Math.floor(max);
  return Math.floor(Math.random() * (max - min + 1) + min); //The maximum is inclusive and the minimum is inclusive
}
